import React from 'react';

const Login = () => (
    <div className="login">
        <h3>Login</h3>
        <label>
            Employee ID: 
            <input type="text"/>
        </label>
        <label>
            <p>Password: </p>
            <input type="text"/>
        </label>
    </div>

);

export default Login;
